Reviewing- Deadpool

This is one of the few films that I like that breaks the fourth wall as this a technique I don't really like but this this is an exception. The humour in this film is great along with the characters and the soundtrack is very fitting for the comedic effect. Ryan Reynolds is a fantastic portrayal of Deadpool and with a strong sequel Deadpool is one of the better Marvel films in my opinion as it's aimed at adults but still has references to the X-Men franchise which is always a good technique to keep fans engaged.

