vie became really compelling and intriguing after that. This was told to be the first superhero horror movie, and I wouldn‚Äôt call it that, but it had some very tense and scary moments. I liked that the movie actually does cool and weird stuff, instead of just playing it safe and generic. It‚Äôs cool how the movie directly confirms that this is part of the X-Men movie universe, and the references to the franchise were cool. Overall a surprisingly good ending to the X-Men franchise, with likable characters, a slow building but intriguing and engaging story when it first gets going, cool powers, good action, great CGI, and cool references to the larger universe, I‚Äôll give it a 4+ #thenewmutants #xmen #marvel #marvelcomics #marvellegends #marveluniverse #marvelfox #foxmarvel #fox #20thcenturyfox #20thcenturystudios #mcu #marvelcinematicuniverse #wolverine #professorx #maisiewilliams #anyataylorjoy #charlieheaton #alicebraga #bluhunt #henryzaga #adambeach #thomaskee #colbigannett #happyanderson #dustinceithamer #marilynmanson #hughjackman #deadpool #ryanreynolds";}i:199;a:1:{s:14:"comments_count";i:0;}i:200;a:1:{s:11:"likes_count";i:1;}i:201;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEurxsegat6";}i:202;a:1:{s:5:"image";s:249:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118846706_254995378916747_7429441502442720411_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=111&_nc_ohc=Kx6a5MbAObYAX_atLtC&oh=0d43d0edf77ce5f8ccb7737aca40f6b5&oe=5F7CA6EC";}i:203;a:1:{s:4:"type";s:5:"image";}i:204;a:1:{s:8:"owner_id";i:12534617344;}i:205;a:1:{s:14:"owner_username";s:0:"";}i:206;a:1:{s:14:"owner_fullname";s:0:"";}i:207;a:1:{s:9:"owner_pic";s:0:"";}i:208;a:1:{s:2:"id";s:19:"2391039582136033511";}i:209;a:1:{s:10:"short_code";s:11:"CEurdTpHeDn";}i:210;a:1:{s:12:"created_time";i:1599254177;}i:211;a:1:{s:7:"caption";s:286:"This is how a super hero actually lands 
